ControlPropertyState.AutoRuleBindingString:
//============================== << 화면 최초 접속 시 >> ==============================
// 1. 로딩 이미지 활성화
Concurrent(
    UpdateContext({locLoadingSpinner:true}), // 로딩 스피너 이미지 비활성
    UpdateContext({locLoadingSpinnerBackground:true})
); // 로딩 스피너 배경 이미지 비활성 );

// 2. 초기화
Concurrent(
    Refresh(똑실이_Token_table),       // DB REFRESH
    UpdateContext({locPopupBackground:false}),  // 팝업 배경 이미지 비활성화

    Set(DatePickerSetting, false),
    Set(AxisPickingList, ["토큰 사용량", "GPT 버전", "카테고리"]); // 

    ClearCollect(
        colCategoryAdmin,
        {Category_LV1: DEFAULT_CATEGORY_VALUE, Category_LV2: DEFAULT_CATEGORY_VALUE, LV1Order: 0, CategoryType: "None"},
        ForAll(
            Table(ParseJSON('[DEV]똑실이-[Apps]일반관리자카테고리목록'.Run(User().Email).assigned_categories)),
            {
                Category_LV1: Text(ThisRecord.Value.Category_LV1),
                Category_LV2: Text(ThisRecord.Value.Category_LV2),
                Category_LV1LV2: Text(ThisRecord.Value.Category_LV1) & "/" & Text(ThisRecord.Value.Category_LV2)
            }
        )
    );
);

//============================== << 필터 초기화 및 로딩이미지 비활성화 >> ==============================
Concurrent(
    Set(AIGraph_Col1, ColorValue(CSS_COMMON.colors.red1)),
    Set(AIGraph_Col2, ColorValue(CSS_COMMON.colors.orange1)),
    Set(AIGraph_Col3, ColorValue(CSS_COMMON.colors.yellow1)),
    Set(AIGraph_Col4, ColorValue(CSS_COMMON.colors.green1)),
    Set(AIGraph_Col5, ColorValue(CSS_COMMON.colors.mustard1)),
    Set(AIGraph_Col6, ColorValue(CSS_COMMON.colors.red2)),
    Set(AIGraph_Col7, ColorValue(CSS_COMMON.colors.orange2)),
    Set(AIGraph_Col8, ColorValue(CSS_COMMON.colors.yellow2)),
    Set(AIGraph_Col9, ColorValue(CSS_COMMON.colors.green2)),

    Set(SelectedLV1_AIGraph, DEFAULT_CATEGORY_VALUE),
    Set(SelectedLV2_AIGraph, DEFAULT_CATEGORY_VALUE),
    Set(AIGraphAxis, First(AxisPickingList)),
    Set(AppsBIAxis, Radio_ChartView_AIGraph_DEV_2.Selected),

    Reset(Dropdown_GalleryFilter_CategoryLV1_AIGraph_DEV_2),
    Reset(Dropdown_GalleryFilter_CategoryLV2_AIGraph_DEV_2),
    Reset(Dropdown_DatePicker_AIGraph_DEV_2),
    Reset(DatePicker_FirstDate_AIGraph_DEV_2),
    Reset(DatePicker_LastDate_AIGraph_DEV_2),
    Reset(Radio_ChartView_AIGraph_DEV_2),
    Reset(Toggle_AIGraph_DEV_2),
    Select(Button_Table_Filtering_AIGraph_DEV_1_2)
);

Select(Button_Table_Filtering_AIGraph_DEV_1_2);

Concurrent(
    Set(AIGraphColorLists, [
        AIGraph_Col1,AIGraph_Col2,AIGraph_Col3,AIGraph_Col4,AIGraph_Col5,AIGraph_Col6,AIGraph_Col7,AIGraph_Col8,AIGraph_Col9,
        AIGraph_Col1,AIGraph_Col2,AIGraph_Col3,AIGraph_Col4,AIGraph_Col5,AIGraph_Col6,AIGraph_Col7,AIGraph_Col8,AIGraph_Col9
    ]),

    UpdateContext({locLoadingSpinner:false}), // 로딩 스피너 이미지 비활성
    UpdateContext({locLoadingSpinnerBackground:false}) // 로딩 스피너 배경 이미지 비활성
);

UpdateContext({
    tokenSearchResponse: '[DEV]똑실이-[Apps]AIGraph토큰사용성분석'.Run(
        If(
            Dropdown_GalleryFilter_CategoryLV1_AIGraph_DEV_2.Selected.Value = DEFAULT_CATEGORY_VALUE && Dropdown_GalleryFilter_CategoryLV2_AIGraph_DEV_2.Selected.Value = DEFAULT_CATEGORY_VALUE,
            // LV1=전체 LV2=전체 일경우
            "/" & Substitute(Concatenate(Concat(LastN(colCategoryAdmin,CountRows(colCategoryAdmin)-1), Category_LV1LV2 & "?"),"delete_point"),"?delete_point",""),
            // 카테고리LV1만 선택한 경우
            If(
                Dropdown_GalleryFilter_CategoryLV1_AIGraph_DEV_2.Selected.Value <> DEFAULT_CATEGORY_VALUE && Dropdown_GalleryFilter_CategoryLV2_AIGraph_DEV_2.Selected.Value = DEFAULT_CATEGORY_VALUE,
                Substitute(Concatenate(Concat(Filter(LastN(colCategoryAdmin,CountRows(colCategoryAdmin)-1),Category_LV1 = Text(Dropdown_GalleryFilter_CategoryLV1_AIGraph_DEV_2.Selected.Value)), Category_LV1LV2 & "?"),"delete_point"),"?delete_point",""),
                // 카테고리LV2만 선택한 경우
                If(
                    Dropdown_GalleryFilter_CategoryLV1_AIGraph_DEV_2.Selected.Value = DEFAULT_CATEGORY_VALUE && Dropdown_GalleryFilter_CategoryLV2_AIGraph_DEV_2.Selected.Value <> DEFAULT_CATEGORY_VALUE,
                    Substitute(Concatenate(Concat(Filter(LastN(colCategoryAdmin,CountRows(colCategoryAdmin)-1),Category_LV2 = Text(Dropdown_GalleryFilter_CategoryLV2_AIGraph_DEV_2.Selected.Value)), Category_LV1LV2 & "?"),"delete_point"),"?delete_point",""),
                    // LV1, LV2 둘다 선택한 경우
                    Dropdown_GalleryFilter_CategoryLV1_AIGraph_DEV_2.Selected.Value & "/" & Dropdown_GalleryFilter_CategoryLV2_AIGraph_DEV_2.Selected.Value
                )
            )
        )
        ,{
        // StartDate
        text_1: Text(DatePicker_SearchDateMin_TokenMenu_1.SelectedDate, "yyyy-mm-dd"),
        // EndDate
        text_2: Text(DatePicker_SearchDateMax_TokenMenu_1.SelectedDate, "yyyy-mm-dd")
    }).result_json
});

ClearCollect(
    tokenSearchResult_1,
    ForAll(
        Table(ParseJSON(tokenSearchResponse)),
        {
            Category_LV1: Text(ThisRecord.Value.Category_LV1),
            Category_LV2: Text(ThisRecord.Value.Category_LV2),
            Token_Question: Text(ThisRecord.Value.Token_Question),
            Token_Answer: Text(ThisRecord.Value.Token_Answer),
            //Token_Date: Text(ThisRecord.Value.Token_Date, "yyyy-mm-dd"),
            Token_Date: Text(DateAdd(ThisRecord.Value.Token_Date, -TimeZoneOffset(), TimeUnit.Minutes), "yyyy-mm-dd"),
            Token_Input: Text(ThisRecord.Value.Token_Input),
            Token_Output: Text(ThisRecord.Value.Token_Output),
            Token_Total: Text(ThisRecord.Value.Token_Total),
            ID: Int(ThisRecord.Value.ID)
        }
    )
);

UpdateContext({ 
    locLoadingSpinner: false
});

Set(AppsBIAxis, Self.Selected);
Set(SelectedLV1_AIGraph, DEFAULT_CATEGORY_VALUE);
Set(SelectedLV2_AIGraph, DEFAULT_CATEGORY_VALUE);
Select(Button_Table_Filtering_AIGraph_TokenUsage);

Set(SelectedLV1_AIGraph, DEFAULT_CATEGORY_VALUE);
Set(SelectedLV2_AIGraph, DEFAULT_CATEGORY_VALUE);

If(
    Self.Selected.Value = "직접설정",
    Set(DatePickerSetting,true),
    Set(DatePickerSetting,false)
);

Select(Button_Table_Filtering_AIGraph_UserSatisf_1)
